measurements.description:
Thirty-four flowers and one bud on three up to 72-cm inflorescences;
sepals and petals lanceolate, light olive green, boldly striped light mahogany, dorsal sepal very hooded;
lip slightly recurved distally, side lobes erect, cream overlaid light yellow distal half, 
side lobes striped brown, midlobe spotted mahogany, central mahogany stripe, keel cream spotted mahogany;
column white overlaid yellow anterior, striped mahogany interior, anther cap cream, mahogany picotee;
 substance firm; texture matte.
